import React from 'react';

const TaskCard = props => {
  return (
      <tr>
        <td>
          {props.task.task}
        </td>
        <td>
          {props.task.complete ? "Complete" : "Incomplete"}
        </td>
        <td>
          {props.task.date}
        </td>
      </tr>
  )
}

export default TaskCard;
